import React, { Component } from 'react';
import "bulma/css/bulma.css";
import './Navbar.css';
import Github from '../Images/github_logo.png'
import LinkedIn from '../Images/linkedin_logo.png'

// const [isActive, setActive] = React.useState(false);

class Navbar extends Component {
  constructor(props) {
    super(props);
    this.state = {
      isActive: false
    };
  }

responsiveNavbar = () => {
  this.setState({ isActive: !this.state.isActive });
  console.log(this.state.isActive);
};
  render() {
    return (
    <div>
    <nav class="navbar" role="navigation" aria-label="main navigation">
      <div class="navbar-brand">
        <div class="navbar-item">
          <div className="my_Label">
            Brendan Muldowney
          </div>
        </div>
        <a onClick={() => this.responsiveNavbar()} role="button" class='navbar-burger burger ${this.state.isActive ? "is-active" : ""}'
           aria-label="menu" aria-expanded="false" data-target="navbarBasicExample">
          <span aria-hidden="true"></span>
          <span aria-hidden="true"></span>
          <span aria-hidden="true"></span>
        </a>
      </div>

      <div id="navbarBasicExample" class={'navbar-menu ${isActive ? "is-active" : ""}'}>
        <div class="navbar-start">
          <a class="navbar-item">
            About
          </a>
          <a class="navbar-item">
            Resume
          </a>
          <a class="navbar-item">
            Projects
          </a>
          <a class="navbar-item">
            Contact
          </a>
        </div>

        <div class="navbar-end">
          <div class="navbar-item">
            <div class="buttons">
              <a class="button is-link is-outlined">
                <img src={Github} width="30" height="30"/>
              </a>
              <a class="button is-link is-outlined">
                <img src={LinkedIn} width="30" height="30"/>
              </a>
            </div>
          </div>
          <div class="navbar-item">
          <div className = "navbar_Spacing">
          test
          </div>
          </div>
        </div>
      </div>
    </nav>
    </div>
    );
  }
}

export default Navbar;
